import Hero from "./Hero";
import SearchResults from "./SearchResults";
import axios from "axios";

const Main = () => {
  const [state, setState] = useState({
    categories: {
      data: []
    }
  });

  useEffect(() => {
    axios("http://localhost:5000/api/project-categories")
      .then(categories => {
        console.log("hello");
        setState(categories);
      })
      .catch(err => console.log(err));
  }, [state]);
  return <div>{/* <Hero />
      <SearchResults /> */}</div>;
};

export default Main;
